I'm glad to hear you're interested in compiler optimization! Here are a few popular techniques along with simple examples to illustrate how they work:

1. **Constant Folding**: This technique involves evaluating constant expressions at compile time instead of runtime. It helps to reduce the number of instructions executed at runtime.

   *Before optimization:*
   ```c
   int add(int a, int b) {
       return a + b;
   }
   int result = add(2, 3);
   ```

   *After constant folding:*
   ```c
   int result = 5;
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are not used. This helps to reduce the size of the generated code.

   *Before optimization:*
   ```c
   int foo(int a) {
       int b = a * 2;
       int c = b + 1;
       return c;
   }
   int result = foo(5);
   ```

   *After DCE:*
   ```c
   int result = foo(5);
   ```

3. **Common Subexpression Elimination (CSE)**: CSE identifies and eliminates redundant expressions by computing them only once and storing the result.

   *Before optimization:*
   ```c
   int bar(int a) {
       int x = a * a;
       int y = x * 2;
       int z = x * 3;
       return y + z;
   }
   int result = bar(4);
   ```

   *After CSE:*
   ```c
   int bar(int a) {
       int x = a * a;
       int y = x * 2;
       int z = x * 3;
       return y + z;
   }
   int result = bar(4);
   ```

   *Optimized version:*
   ```c
   int bar(int a) {
       int x = a * a;
       int y = x * 2;
       return y + (x * 3);
   }
   int result = bar(4);
   ```

4. **Loop Invariant Code Motion (LICM)**: LICM moves code that is invariant within a loop out of the loop, reducing the number of times the code is executed.

